UPDATE PA_MEASURECALC SET AD_CLIENT_ID=0,AD_ORG_ID=0,ISACTIVE='Y',CREATEDBY=0,UPDATEDBY=100,NAME='Invoiced Net Revenue',DESCRIPTION='Invoiced net revenue, without tax and charges',SELECTCLAUSE='SELECT SUM(il.LineNetAmt)  FROM RV_C_Invoice C_Invoice   INNER JOIN RV_C_InvoiceLine il ON (C_Invoice.C_Invoice_ID=il.C_Invoice_ID)',WHERECLAUSE='WHERE C_Invoice.IsSOTrx=''Y'' AND C_Invoice.Processed=''Y''',DATECOLUMN='C_Invoice.DateInvoiced',ORGCOLUMN='C_Invoice.AD_Org_ID',BPARTNERCOLUMN='C_Invoice.C_BPartner_ID',PRODUCTCOLUMN='il.M_Product_ID',AD_TABLE_ID=318,KEYCOLUMN='C_Invoice.C_Invoice_ID',ENTITYTYPE='D' WHERE PA_MEASURECALC_ID=100;
